import React, { Component } from "react";

class News_Block extends Component {
  render() {
    return (
      <div className="card" style={{ width: "18rem" }}>
        <img
          className="card-img-top"
          src="https://znews-photo.zadn.vn/w480/Uploaded/mdf_nemddf/2020_06_04/Nguyen_Ba_Duong_CTD_1.jpg"
          alt="Card image cap"
        />
        <div className="card-body">
          <h5 className="card-title">Card title</h5>
          <p className="card-text">
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </p>

          <div className="button_group">
            <a href="#" className="btn btn-primary btnLeft">
            Quick view
            </a>
            <a href="#" className="btn btn-primary ntnRight">
              Full view
            </a>
            
          </div>
        </div>
      </div>
    );
  }
}

export default News_Block;
